rice=J;ca.discount=J;ca.product_type={name:e,type:c,is_saleable:b};gW.id=L;gW.name="Rainbow Umbrella";gW.slug="rainbow-umbrella";gW.product_type_id=f;gW.price=J;gW.discount=J;gW.is_active=d;gW.description="\u003Ch4\u003EProduct Lowdown\u003C\u002Fh4\u003E\n\u003Cdiv class=\"std\" itemprop=\"description\"\u003E\nNeed some shade or to take cover from the rain? Our nifty foldable umbrellas are compact enough to carry in your bag and you can pop them out whenever you need them. Features:Foldable umbrellaCoverWrist strap\u003Cdiv class=\"pdpDescContent\"\u003E\u003Cbr\u003E\u003Cbr\u003E\u003Cb class=\"pdpDesc\"\u003EFabric Content:\u003C\u002Fb\u003E\u003Cbr\u003E100 % Polyester\u003Cbr\u003E\u003Cbr\u003E\u003Cb class=\"pdpDesc\"\u003EWash Care:\u003C\u002Fb\u003E\u003Cbr\u003EDo not wash\u003C\u002Fdiv\u003E \u003C\u002Fdiv\u003E\n\u003Ch4\u003EMRP & Co\u003C\u002Fh4\u003E\n\u003Cspan\u003EIntroducing MRP&amp;Co. A whole new world of imagination! Tech gadgets, pool accessories, novelty goodies &amp; loads more.\u003C\u002Fspan\u003E \u003Ch4\u003EDelivery & Returns\u003C\u002Fh4\u003E \n\u003Cp\u003E\u003Cstrong\u003EWhen will I receive my online order?\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\n\u003Cp\u003ECLICK &amp; COLLECT: Your order will take between 5-8 working days* to get to you. You can track your order online under my account and we will also notify you via email when your order has been received, when your order has been shipped and again when your order has reached the store you have selected. We will also email you to remind you to collect your order if you have not collected it after 7 days, and again after 14 days.\u003Cbr\u003E\u003Cbr\u003E DOOR TO DOOR: Your order will take between 3-7 working days* to get to you. You can track your order online under my account and we will also notify you via email when your order has been received, when your order has been shipped and again when your order has been delivered.\u003Cbr\u003E\u003Cbr\u003EPARGO PICK-UP POINT\u003Cspan style=\"color: #e02124;\"\u003E\u003Cstrong\u003E - New!\u003C\u002Fstrong\u003E\u003C\u002Fspan\u003E : Your order will take between 2-3 working days* to arrive at a collection point ready for you to collect. Shop online and collect your parcel from a convenient Pargo Pickup Point instead of waiting for your home delivery. Enjoy the flexibility of collecting parcels whenever it suits you, including on weekends and after work at hundreds of popular collection points nationwide. Parcels are tracked at all times and stored in a safe and secure area.\u003C\u002Fp\u003E\n\u003Cbr\u003E\n\u003Cp\u003E\u003Cstrong\u003EWhat safety measures have you put in place for online shopping?\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\n\u003Cp\u003EWe want to make sure you have the confidence to shop online and get all the winter essentials you need without leaving the house. Our fulfilment partners have implemented several precautionary measures including the screening of staff and regular cleaning of equipment and fixtures while they process your orders. Together with our couriers, we have introduced contactless delivery and mandatory health checks for all drivers. Each driver has also been equipped with masks and sanitiser.\u003C\u002Fp\u003E\n\u003Cbr\u003E\n\u003Cp\u003E\u003Cstrong\u003EWhat is Scan to Pay?\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\n\u003Cp\u003EScan to pay is the next-level when it comes to easy, contactless payments. All you need is your phone, the \u003Ca style=\"color: #000000; font-weight: bold;\" href=\"https:\u002F\u002Fwww.mrp.com\u002Fen_za\u002Ffeatures\u002Fthe-mrp-fashion-app\u002F\"\u003EMr Price APP\u003C\u002Fa\u003E and you’re ready to scan and pay! No more wallets, cards, cash and unnecessary contact. You can also link your Mr price Money account to your app to make payments.\u003C\u002Fp\u003E";gW.created_at="2021-01-23 02:54:17";gW.updated_at="2021-01-23 02:54:18";gW.photo="b1181809b21cba77fd7047545ee21b51dd872f7d.jpeg"